import React, { Component } from 'react';
import Automate from '../../components/Automate/Automate'
import Camera from '../../components/Navbar/Components/Camera/Camera'
// import Logout from '../Logout'
import './nav.css'

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";


class Navbar extends Component {
  render() {
    return (
      <div>
        <Router>
          <div class="container">
              <div class="item">
                <Link to="/automate" >Automate</Link>
              </div>
              <div class="item">
                <Camera />
              </div>
              {/* <li> */}
                {/* <Link to="/logout">Sign Out</Link>
                </li> */}
          </div>  
          <Switch>
              <Route path="/automate"></Route>
              <Route path="/camera"></Route> 
              {/* <Route path="/logout">
                <Logout />
              </Route> */}
          </Switch>
        </Router>
      </div>
    );
  }
}


export default Navbar;
